// export default ListOfStudents
import React from "react";
import { connect } from "react-redux";
import {
  Container,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
  Card,
} from "@material-ui/core";
import { Link } from "react-router-dom";

const ListOfStudents = (props) => {
  let loggedIn = document.cookie;
  const students = ListOfStudents;
  return (
    <Container maxWidth="lg" className="students-container">
      <div className="Gallery">
        <Table>
          <TableBody>
            {props.list.map((studList, idx) => (
              <TableRow key={studList.id}>
                <TableCell component="th" scope="row">
                  {studList.id}
                </TableCell>
                <TableCell>{studList["name"]}</TableCell>
                <TableCell>{studList["mpg"]}</TableCell>
                <TableCell>{studList["cylinders"]}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </div>
    </Container>
  );
};

export default ListOfStudents;
